import React from 'react';
import './Elementarybox.css'
const ElementaryBox = () => {
    const boxStyle = {
        width: '1154px',
        height: '216px',
        position: 'absolute',
        top: '50%',
        left: '139px',
        right: '1293px',
        marginTop: '-170px',
        transform: 'translateY(-50%)',
        borderRadius  : '20px' ,
        // border: '1px solid #000', // Пример рамки для наглядности
        backgroundColor: 'rgb(255, 211, 105)',
    };

    const subBoxStyle = {
        width: '261px',
        height: '439px',
        border: '1px solid #000',
        backgroundColor: 'border: 1px solid #ccc;',
        position: 'absolute',
        bottom: '0',
        marginBottom: '-500px' ,
        borderRadius: '20px',
    };



    return (
        <div style={boxStyle}>
            <h1>ELEMENTARY</h1>
            <p>Расскажи о семье, что ты любишь и о своём лучшем друге!</p>
            <div style={{ ...subBoxStyle, left: '0', background: 'linear-gradient(to bottom, lightblue 50%, lightgreen 50%)' }}></div>
            <div style={{ ...subBoxStyle, left: '291px', background: 'linear-gradient(to bottom, lightblue 50%, lightgreen 50%)' }}></div>
            <div style={{ ...subBoxStyle, left: '582px', background: 'linear-gradient(to bottom, lightblue 50%, lightgreen 50%)' }}></div>
            <div style={{ ...subBoxStyle, left: '873px', background: 'linear-gradient(to bottom, lightblue 50%, lightgreen 50%)' }}></div>
        </div>

    );
};

export default ElementaryBox;
